// src/home.js
import React from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';

const Home = () => {
  return (
    <div>
      <h1>Selamat Datang di Halaman Utama!</h1>
      <p>Ini adalah halaman utama dari proyek React sederhana.</p>


      <Link to="/register">
          <button>Register</button>
      </Link>
    </div>
  );
}

export default Home;
